import React from 'react';
import '../assets/css/style.css';

const Home = () => (
  <div className="banner">
    <video src="/assets/bgvid.mp4" autoPlay muted loop></video>
    <div className="content">
      <h1>Travel-Tribe</h1>
      <p>Plan your trip with us and explore the world!</p>
      <a href="/register" className="button">Register Now</a>
    </div>
  </div>
);

export default Home;
